from math import ceil


menulookup = {}
cursor = context.cursor()
cursor.execute("select * from girleffect.gc_tbl_menuitems where categoryid != 0")
menu_results = cursor.fetchall()

cursor.execute("select COUNT(ucid) as count from girleffect.gc_stg_basedata")
count = cursor.fetchone()[0]
current = 0
limit = 50000
iterations = 0

menuitem_menuid = [int(i[0]) for i in menu_results]
for menu in menu_results:
    menulookup[str(menu[0])] = menu[3]
    menulookup[str(menu[0]) + 'cid'] = menu[2]

while iterations < ceil(float(count)/limit):
    allvalues = []
    cursor.execute(
        "select accessservice, ucid from girleffect.gc_stg_basedata where ucid is not null order by ucid LIMIT {} OFFSET {}".format(limit, current)
    )
    accessservices = cursor.fetchall()

    for accessservice in accessservices:
        values = {
            'ucid': accessservice[1],
            'rc_EpisodeId': 'Null',
            'rc_acceptedsurvey': False,
            'rc_selectedpassword': False,
            'rc_servedpassword': False,
            'rc_termscondaccepted': False,
            'rc_termscond': False,
            'rc_episodewatched': False,
        }
        split_menuid = accessservice[0].split('|')
        for i in range(len(split_menuid)):
            if int(split_menuid[i]) in menuitem_menuid:
                if int(menulookup.get(str(split_menuid[i]) + 'cid')) > 6000:
                    values['rc_episodewatched'] = True if i+1 < len(split_menuid) else False
                    values['rc_EpisodeId'] = int(menulookup.get(str(split_menuid[i]) + 'cid'))

                if menulookup[str(split_menuid[i])] == 'rc_AcceptedSurvey':
                    values['rc_acceptedsurvey'] = True

                if menulookup[str(split_menuid[i])] == 'rc_SelectedPassword':
                    values['rc_selectedpassword'] = True

                if menulookup[str(split_menuid[i])] == 'rc_ServedPassword':
                    values['rc_servedpassword'] = True

                if menulookup[str(split_menuid[i])] == 'rc_TermsCondAccepted':
                    values['rc_termscondaccepted'] = True

                if menulookup[str(split_menuid[i])] == 'rc_TermsCond':
                    values['rc_termscond'] = True

        allvalues.append(values)

    sql = """
    INSERT INTO girleffect.gc_stg_accessservice 
    (ucid, rc_EpisodeId, rc_acceptedsurvey, rc_selectedpassword, rc_servedpassword, rc_termscondaccepted, rc_termscond, rc_episodewatched)
    VALUES {};
    """.format(
        '{}'.format(
            ','.join('({},{},{},{},{},{},{},{})'.format(
                x['ucid'], x['rc_EpisodeId'], x['rc_acceptedsurvey'], x['rc_selectedpassword'],
                x['rc_servedpassword'], x['rc_termscondaccepted'], x['rc_termscond'], x['rc_episodewatched'],
            ) for x in allvalues)
        )
    )
    cursor.execute(sql)
    current += limit
    iterations += 1

